    83→          faceapi.nets.faceLandmark68Net.loadFromUri(MODEL_URL),
    84→          faceapi.nets.tinyFaceDetector.loadFromUri(MODEL_URL),
    85→          faceapi.nets.faceLandmark68TinyNet.loadFromUri(MODEL_URL),
    86→        ]);
    87→
    88→        modelsLoaded = true;
